import styled from "styled-components"

export const Heading = styled.h3`
font-weight: 600;
font-size: 32px;
line-height: 39px;
color: #03435F;
text-align: center;
`

export const ScoreCardHeading = styled.span`
font-weight: 600;
font-size: 32px;
color: #03435F;
margin-top: 50px;
`
export const LoginHeading = styled.h3`
font-weight: 600;
font-size: 32px;
font-weight: bold;
color: #03435F;
margin: 5rem 0;
`

export const Label = styled.label`
  margin-bottom: 0.5rem;
  color: #03435f;
  font-weight: bold;
  display: block;
`

export const Paragraph = styled.p`
font-weight: 400;
font-size: 16px;
line-height: 19px;
color: #BDBDBD;
padding: 2rem 2.5rem 0.1rem 2.5rem;
`


export const HorizontalLine = styled.div`
border: 1px solid #D9D9D9
`

export const ButtonText = styled.p`
color: #FFFFFF;
`

export const LoginButtonBody = styled.button`
width: calc(100% - 0.21rem);
height: 2.5rem;
color: white;
border: 1px solid rgba(33, 51, 79, 0.15);
margin: 0.4rem 0;
background: linear-gradient(96.67deg, #34A853 0%, #B8D344 100%);
`

export const Input = styled.input`
  border: 0.15rem solid rgba(33, 51, 79, 0.15);
  color: #21334f;
  width: calc(100% - 1.5rem);
  padding: 0.4rem 0.5rem;
  display: inline-block;
  margin-bottom: 0.8rem;
  font-size: 0.9rem;
  line-height: 1.5rem;
  height: 1.3rem;
`;

export const ButtonBody = styled.button`
  width: calc(100% - 0.21rem);
  height: 2.5rem;
  font-weight: 500;
  font-size: 1rem;
  line-height: 1.5rem;
  border: 1px solid rgba(33, 51, 79, 0.15);
  padding: 0.8rem;
  text-align: center;
  color: #fff;
  cursor: pointer;
  margin: 0.4rem 0;
  background: #14a800;
`;

export const FormCardBody = styled.div`
  background: #fff;
  width: 50%;
  /* height: 80vh; */
  margin: 3rem auto 0;
`;
export const AdminFormCard = styled.div`
  background: #fff;
  width: 0%;
  margin: 3rem auto 0;
`;

